import { useEffect } from "react";
import axios from "axios";
const API_URL = "http://localhost:8080/";
import './App.css';

const App = () => {
  const getItemsByCode = (code) => {
    axios.get(`${API_URL}item?code=${code}`).then((res) => {
      console.log(res);
    });
  };

  useEffect(() => {
    getItemsByCode("1");
  });

  return (
    <div className="app">
      <h1>corkboard</h1>
      <input placeholder="code..."></input>
      <button>Use Code!</button>
      <button>New Code!</button>
    </div>
  );
};

export default App;
